Een groepje van acht getalenteerde kandidaten is geslaagd voor een laatste test en mag nu deel worden van een machtige, maar 
mysterieuze organisatie. Ze gaan een kamer zonder ramen binnen en krijgen hier tachtig minuten de tijd om slechts ÃƒÂ©ÃƒÂ©n vraag te 
beantwoorden. Er zijn echter wel een paar regels waaraan ze moeten voldoen, anders worden ze gediskwalificeerd; ze mogen niet 
praten tegen de opdrachtgever, de bewapende bewaker bij de deur, hun vragenlijsten bekladderen, of de kamer verlaten. De tijd 
gaat in, en de opdrachtgever verdwijnt. De kandidaten bekijken de papieren waarop de vragen zouden moeten staan, maar tot hun 
verbazing zijn deze blanco. Samen besluiten ze uit te zoeken wat de vraag is, maar doordat ze elkaars achtergrond ontdekken, 
lopen de spanningen hoog op.
